import React from 'react';
import { Link } from 'react-router-dom';


class Documentation extends React.Component {
  render() {
  	return (
        <section className="section pt-5" id="documentation">
            <div className="container">
                <div className="row">
                    <div className="col-lg-8 offset-lg-2">
                        <h1 className="section-title text-center">Documentation</h1>
                        <div className="section-title-border margin-t-20"></div>
                        <p className="section-subtitle text-muted text-center padding-t-30 font-secondary">Easy to follow documentation.</p>
                    </div>
                </div>
                <Link to="">Learn More <i className="mdi mdi-arrow-right"></i></Link>
            </div>
        </section>
  	);
  }
}
export default Documentation;
